import React, { Component } from "react";

class NavPage extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          backgroundColor: "orange",
          width: 400,
          height: 20,
          position: "absolute",
          right: 0,
        }}
      ></div>
    );
  }
}

export default NavPage;
